// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

contract Treasury is Ownable, ReentrancyGuard {
    using SafeERC20 for IERC20;
    using SafeMath for uint256;

    IERC20 private token;

    address private constant addressZero = address(0x00000000000);

    address admin;
    uint256 public depreciationRate;
    uint256 public minimumValue = 1000;
    uint256 public balanceOfAdmin;
    uint256 public balanceTokenOfAdmin;
    address public treasuryAdmin;

    mapping(address => uint256) private balanceOfUserDigger;

    event userBuyDigger(
        address indexed admin,
        address indexed host,
        uint256 amount
    );
    event changeDepreciationRate(uint256 indexed depreciationRate);
    event changeMinimumValue(uint256 indexed minimumValue);
    event claimEvent(
        uint256 amount,
        address indexed token,
        address indexed user
    );

    constructor(
        address _admin,
        address _treasuryAdmin,
        address _token,
        uint256 _minimumValue,
        uint256 _depreciationRate
    ) {
        token = IERC20(_token);
        admin = _admin;
        treasuryAdmin = _treasuryAdmin;
        minimumValue = _minimumValue;
        depreciationRate = _depreciationRate;
    }

    modifier checkbuyDigger(uint256 _amount) {
        require(
            balanceOfUserDigger[msg.sender] >= depreciationRate,
            "balance not more than depreciationRate"
        );
        require(
            _amount <= token.balanceOf(address(this)),
            "contract not enough fund"
        );
        _;
    }

    function checkBalanceContract() external view onlyOwner returns (uint256) {
        return token.balanceOf(address(this));
    }

    function buyDiggerNative() external payable returns (bool) {
        require(minimumValue <= msg.value, "balance is not enough");
        payable(treasuryAdmin).transfer(msg.value);
        balanceOfAdmin += msg.value;
        balanceOfUserDigger[msg.sender] -= msg.value;
        emit userBuyDigger(msg.sender, addressZero, msg.value);
        return true;
    }

    function buyDigger(uint256 _amount) external payable returns (bool) {
        require(
            minimumValue <= token.balanceOf(msg.sender),
            "balance is not enough"
        );
        token.safeTransferFrom(msg.sender, treasuryAdmin, _amount);
        balanceTokenOfAdmin += _amount;
        balanceOfUserDigger[msg.sender] -= _amount;
        emit userBuyDigger(msg.sender, address(token), _amount);
        return true;
    }

    function setMinimumValue(uint256 _minimumValue) public onlyOwner {
        minimumValue = _minimumValue;
        emit changeMinimumValue(_minimumValue);
    }

    function setDepreciationRate(uint256 _depreciationRate) public onlyOwner {
        depreciationRate = _depreciationRate;
        emit changeDepreciationRate(_depreciationRate);
    }

    function claim(uint256 _amount, address user)
        external
        checkbuyDigger(_amount)
        nonReentrant
        onlyOwner
        returns (bool)
    {
        token.safeTransferFrom(address(this), user, _amount);
        balanceOfUserDigger[user] -= depreciationRate;
        emit claimEvent(_amount, address(token), user);
        return true;
    }
}
